    public List<Integer> BM(String source, String pattern) {
        if (source == null || pattern == null || source.length() < 1 || pattern.length() < 1) {
            return new ArrayList<>();
        }
        char[] sourceArray = toCharArray(source);
        char[] patternArray = toCharArray(pattern);
        int[] badTable = buildBadTable(patternArray);
        int[] goodSuffix = buildGoodSuffixTable(patternArray);
        List<Integer> arrayList = new ArrayList<>();
        for (int i = patternArray.length - 1, j = 0; i < sourceArray.length; ) {
            for (j = patternArray.length - 1; sourceArray[i] == patternArray[j]; j--, i--) {
                if (j == 0) {
                    arrayList.add(i);
                    break;
                }
            }
            //goodSuffix[patternArray.length - 1 - j] 数组从后往前取值
            i += Math.max(badTable[sourceArray[i]], goodSuffix[patternArray.length - 1 - j]);
        }
        return arrayList;
    }

    private int[] buildGoodSuffixTable(char[] patternArray) {
        int length = patternArray.length;
        int[] goodSuffix = new int[length];
        int lastPrefixLength = length;
        //判断如果没有完全匹配上好后辍，就使用最长前戳
        for (int i = length - 1; i >= 0; i--) {
            if (isPrefix(i + 1, patternArray)) {
                //有前戳算位置
                lastPrefixLength = i + 1;
            }
            //没前戳整个跳过
            goodSuffix[length - 1 - i] = lastPrefixLength + length - 1 - i;
        }
        for (int i = 0; i < length - 1; i++) {
           int slen = suffix(i,patternArray);
           goodSuffix[slen] = slen + length - 1 - i;
        }
        return goodSuffix;
    }

    private int suffix(int start, char[] patternArray) {
        int len = 0;
        for (int i = start, j = patternArray.length-1; i >= 0; i--,j--) {
            if(patternArray[i] == patternArray[j]){
                 len += 1;
            }
        }
        return len;
    }

    private boolean isPrefix(int tailStart, char[] patternArray) {
        for (int i = tailStart,j = 0; i < patternArray.length; i++,j++) {
            if (patternArray[i] != patternArray[j]) {
                return false;
            }
        }
        return true;
    }

    private int[] buildBadTable(char[] patternArray) {
        int length = patternArray.length;
        int[] badTable = new int[tableSize];
        for (int i = 0; i < tableSize; i++) {
            //填充值，-1，也就是匹配不到的时候跳过整个字符串大小
            badTable[i] = length;
        }
        for (int i = 0; i < length - 1; i++) {
            int c = patternArray[i];
            //相对位置。该位置往后跳多远
            badTable[c] = length - 1 - i;
        }
        return badTable;
    }

    private char[] toCharArray(String target) {
        char[] charArray = target.toCharArray();
        return charArray;
    }
